export async function getStaticProps() {
  // store.dispatch(fetchMenu());
  // const store = initializeStore();
  // store.dispatch(serverRenderClock());
  const api = serviceApiFormData();
  const res = await api.post("MenuApp/getMenu");
  const menu = res.data;
  return {
    props: {
      menu,
    },
  };
}

const mapDispatchToProps = (dispatch) => {
  return {
    getMetaData: (param) => dispatch(getMetaData(param)),
    getMenu: (param) => dispatch(fetchMenu()),
  };
};

export default connect(null, getMetaData)(Home);
